INSERT INTO `config_info` VALUES (169, 'application-auth-dynamic.yml', 'LOONG', 'server:\n  port: 8081\n\nloong:\n  log:\n    enable: true\n  files:\n    upload: \"./data/files\"\n  auth:\n    permits:\n      - \"/actuator/**\"\n      - \"/v1/auth/login\"\n      - \"/v1/auth/register\"\n      - \"/v1/app/login\"\n      - \"/v1/app/register\"\n      - \"/admin/**\"\n      - \"/instances/**\"\n      - \"/webjars/**\"\n      - \"/images/**\"\n      - \"/css/**\"\n      - \"/**.html\"\n      - \"/**.css\"\n      - \"/doc.html\"\n      - \"/v3/api-docs/**\"\n      - \"/swagger-ui/**\"\n      - \"/swagger-ui.html\"\n      - \"/favicon.ico\"\n\n    defaultPassword: \"88888888\"\n    accessTokenExpire: 86400000\n    refreshTokenExpire: 86400000\n  app:\n    defaultPassword: \"88888888\"\n    accessTokenExpire: 2592000000\n    refreshTokenExpire: 2592000000\n\nlogging:\n  level:\n    com.ronnaces.ronna.cloud.auth: DEBUG\n\n  file:\n    name: auth.log\n    path: ./logs    \n\nspringdoc:\n  group-configs:\n    - group: \'全部模块\'\n      paths-to-match: \'/**\'\n      packages-to-scan: com.ronnaces.ronna.cloud\n    - group: \'认证模块\'\n      paths-to-match: \'/**\'\n      packages-to-scan: com.ronnaces.ronna.cloud.auth', '026934d2c806838339bda2305771469a', '2024-02-27 17:48:13', '2024-02-29 09:37:30', 'nacos', '10.0.0.2', '', 'cloud', '', '', '', 'yaml', '', '');
INSERT INTO `config_info` VALUES (178, 'application-gateway-dynamic.yml', 'LOONG', 'server:\n  port: 8082\n\nloong:\n  log:\n    enable: true\n  files:\n    upload: \"./data/files\"\n  auth:\n    permits:\n      - \"/actuator/**\"\n      - \"/v1/auth/login\"\n      - \"/v1/loong/version/**\"\n      - \"/v1/auth/register\"\n      - \"/v1/app/login\"\n      - \"/v1/app/register\"\n      - \"/admin/**\"\n      - \"/instances/**\"\n      - \"/webjars/**\"\n      - \"/images/**\"\n      - \"/css/**\"\n      - \"/**.html\"\n      - \"/**.css\"\n      - \"/doc.html\"\n      - \"/v3/api-docs/**\"\n      - \"/swagger-ui/**\"\n      - \"/swagger-ui.html\"\n      - \"/favicon.ico\"\n\n    defaultPassword: \"88888888\"\n    accessTokenExpire: 100000\n    refreshTokenExpire: 100000\n\nspring:\n  cloud:\n    gateway:\n      discovery:\n        locator:\n          enabled: true\n          lower-case-service-id: true\n      # routes:\n      #   - id: cloud-auth\n      #     uri: lb://cloud-auth\n      #     predicates:\n      #       - Path=/v1/auth/**\n      #     filters:\n      #       - StripPrefix=1\n      #   - id: modules-entrypoint\n      #     uri: lb://modules-entrypoint\n      #     predicates:\n      #       - Path=/v1/system/**\n      #     filters:\n      #       - StripPrefix=1\n\nknife4j:\n  enableAggregation: true\n  gateway:\n    enabled: true\n    # 排序规则(tag/operation排序自4.2.0版本新增)\n    # 取值：alpha-默认排序规则，官方swagger-ui默认实现,order-Knife4j提供的增强排序规则，开发者可扩展x-order，根据数值来自定义排序\n    #    tags-sorter: order\n    #    operations-sorter: order\n    # 指定服务发现的模式聚合微服务文档，并且是默认`default`分组\n    strategy: discover\n    # 服务发现模式的配置\n    discover:\n      # 开启\n      enabled: true\n      version : openapi3\n      # 需要排除的微服务(eg:网关服务)\n      excluded-services:\n        - cloud-gateway\n      # 如果子服务是OpenAPI3，并且有个性化配置\n#      oas3:\n#        url: /v3/api-docs?group=default\n#        oauth2-redirect-url: \'\'\n#        validator-url: \'\'', 'dc25b779013c4dd37b26e1fa2ab7f024', '2024-02-28 16:04:20', '2024-02-29 10:55:49', 'nacos', '10.0.0.2', '', 'cloud', '', '', '', 'yaml', '', '');
