INSERT INTO `his_config_info` VALUES (178, 198, 'application-gateway-dynamic.yml', 'LOONG', '', 'server:\n  port: 8082\n\nloong:\n  log:\n    enable: true\n  files:\n    upload: \"./data/files\"\n  auth:\n    permits:\n      - \"/actuator/**\"\n      - \"/v1/auth/login\"\n      - \"/v1/loong/version/**\"\n      - \"/v1/auth/register\"\n      - \"/v1/app/login\"\n      - \"/v1/app/register\"\n      - \"/admin/**\"\n      - \"/instances/**\"\n      - \"/webjars/**\"\n      - \"/images/**\"\n      - \"/css/**\"\n      - \"/**.html\"\n      - \"/**.css\"\n      - \"/doc.html\"\n      - \"/v3/api-docs/**\"\n      - \"/swagger-ui/**\"\n      - \"/swagger-ui.html\"\n      - \"/favicon.ico\"\n\n    defaultPassword: \"88888888\"\n    accessTokenExpire: 100000\n    refreshTokenExpire: 100000\n\n  api:\n    title: \"Ronna Cloud\"\n    description: \"Ronna Cloud\"\n    name: \"Ronna Cloud\"\n    mail: luokunlong.loong@gmail.com\n    version: \"v1.0\"\n\nspring:\n  cloud:\n    gateway:\n      discovery:\n        locator:\n          enabled: true\n          lower-case-service-id: true\n      routes:\n        - id: cloud-auth\n          uri: lb://mall-auth\n          predicates:\n            - Path=/v1/auth/**\n          filters:\n            - StripPrefix=1\n        - id: modules-entrypoint\n          uri: lb://modules-entrypoint\n          predicates:\n            - Path=/v1/system/**\n          filters:\n            - StripPrefix=1\n\nknife4j:\n  gateway:\n    enabled: true\n    # 排序规则(tag/operation排序自4.2.0版本新增)\n    # 取值：alpha-默认排序规则，官方swagger-ui默认实现,order-Knife4j提供的增强排序规则，开发者可扩展x-order，根据数值来自定义排序\n    #    tags-sorter: order\n    #    operations-sorter: order\n    # 指定服务发现的模式聚合微服务文档，并且是默认`default`分组\n    strategy: discover\n    # 服务发现模式的配置\n    discover:\n      # 开启\n      enabled: true\n      version : openapi3\n      # 需要排除的微服务(eg:网关服务)\n      excluded-services:\n        - cloud-gateway\n      # 如果子服务是OpenAPI3，并且有个性化配置\n#      oas3:\n#        url: /v3/api-docs?group=default